import React, { useState, useEffect } from 'react';
import { AnalyticsApi } from '../../api';
import './UserManagement.css';

const UserManagement = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [sortBy, setSortBy] = useState('created_at');

  useEffect(() => {
    loadUsers();
  }, []);

  const loadUsers = async () => {
    try {
      // For now, we'll create mock data since we need to implement the users API endpoint
      const mockUsers = [
        {
          id: 1,
          username: 'alice',
          email: 'alice@example.com',
          full_name: 'Alice Johnson',
          bio: 'Coffee and code enthusiast',
          created_at: '2024-10-01',
          posts_count: 12,
          followers_count: 156,
          following_count: 89
        },
        {
          id: 2,
          username: 'bob',
          email: 'bob@example.com',
          full_name: 'Bob Smith',
          bio: 'Traveler and photographer',
          created_at: '2024-10-02',
          posts_count: 8,
          followers_count: 203,
          following_count: 145
        },
        {
          id: 3,
          username: 'carol',
          email: 'carol@example.com',
          full_name: 'Carol White',
          bio: 'Professional photographer',
          created_at: '2024-10-03',
          posts_count: 25,
          followers_count: 412,
          following_count: 67
        }
      ];
      setUsers(mockUsers);
    } catch (error) {
      console.error('Error loading users:', error);
    } finally {
      setLoading(false);
    }
  };

  const filteredUsers = users.filter(user =>
    user.username.toLowerCase().includes(searchTerm.toLowerCase()) ||
    user.full_name?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  if (loading) {
    return (
      <div className="user-management">
        <div className="loading">Loading users...</div>
      </div>
    );
  }

  return (
    <div className="user-management">
      <div className="page-header">
        <h2>User Management</h2>
        <p>Manage platform users and view their activity</p>
      </div>

      <div className="user-controls">
        <div className="search-box">
          <input
            type="text"
            placeholder="Search users..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="search-input"
          />
        </div>
        <div className="sort-controls">
          <select
            value={sortBy}
            onChange={(e) => setSortBy(e.target.value)}
            className="sort-select"
          >
            <option value="created_at">Sort by Join Date</option>
            <option value="posts_count">Sort by Posts</option>
            <option value="followers_count">Sort by Followers</option>
          </select>
        </div>
      </div>

      <div className="users-grid">
        {filteredUsers.map(user => (
          <div key={user.id} className="user-card">
            <div className="user-avatar">
              <span>{user.username.charAt(0).toUpperCase()}</span>
            </div>
            <div className="user-info">
              <h3>@{user.username}</h3>
              <p className="full-name">{user.full_name}</p>
              <p className="bio">{user.bio}</p>
              <div className="user-stats">
                <div className="stat">
                  <span className="stat-number">{user.posts_count}</span>
                  <span className="stat-label">Posts</span>
                </div>
                <div className="stat">
                  <span className="stat-number">{user.followers_count}</span>
                  <span className="stat-label">Followers</span>
                </div>
                <div className="stat">
                  <span className="stat-number">{user.following_count}</span>
                  <span className="stat-label">Following</span>
                </div>
              </div>
              <div className="user-actions">
                <button className="btn btn-primary">View Profile</button>
                <button className="btn btn-secondary">Send Message</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default UserManagement;
